<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>Digital Products</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: 'Roboto', sans-serif;
    }

    .container {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
      gap: 20px;
      padding: 20px;
    }

    .product {
      background-color: #f1f1f1;
      padding: 20px;
      border-radius: 10px;
      text-align: center;
      transition: transform 0.3s ease-in-out;
    }

    .product:hover {
      transform: scale(1.05);
    }

    .product img {
      opacity: 1;
      max-width: 100%;
      height: auto;
    }

    .product h2 {
      font-size: 1.5rem;
      color: rgb(18,18,18);
      margin: 10px 0;
    }

    .product p {
      color: rgb(18,18,18);
      margin: 10px 0;
    }

    .product a {
      display: inline-block;
      padding: 10px 20px;
      background-color: #4CAF50;
      color: #fff;
      text-decoration: none;
      border-radius: 5px;
      transition: background-color 0.3s ease-in-out;
    }

    .product a:hover {
      background-color: #45a049;
    }
  </style>
</head>
